'),(83,'widget_text','a:9:{i:2;a:3:{s:5:\"title\";s:0:\"\";s:4:\"text\";s:19:\"Company Description\";s:6:\"filter\";b:0;}i:3;a:3:{s:5:\"title\";s:0:\"\";s:4:\"text\";s:483:\"<p>At Carlisle Insurance, whether it is for yourself, your business or both, we Take Pride in providing a personalized plan to give you the right coverage now to provide peace of mind in the future. We understand what it means to be proud of what you have, and how important it is to know that is protected. We are proud to offer the strength to protect you when you need it most, the security of a plan tailored to your needs, and the stability of an enduring insurance agency. </p>\";s:6:\"filter\";b:0;}i:4;a:3:{s:5:\"title\";s:0:\"\";s:4:\"text\";s:315:\"<p>As stated in our \"Terms of Service\" (TOS) agreement, descriptions of insurance coverage on this web site are for informational purposes only and may not apply, or be included on your policy. Please contact us to confirm coverage provided on your insurance policy or policies you are contemplating purchasing.</p>\";s:6:\"filter\";b:0;}i:5;a:3:{s:5:\"title\";s:0:\"\";s:4:\"text\";s:45:\"[contact-form-7 id=\"56\" title=\"Contact Form\"]\";s:6:\"filter\";b:0;}i:6;a:3:{s:5:\"title\";s:0:\"\";s:4:\"text\";s:446:\"<a href=\"/commercial-insurance/\"><img src=\"/wp-content/uploads/shutterstock_86449291.jpg\" alt=\"Commercial-Insurance-Corpus-Christi\"/></a>\r\n<h3><a href=\"/commercial-insurance/\" style=\"color:black;\">For Businesses</a></h3>\r\n<p>Your business is important to you. Protecting it, is important to us. We work hard to find the right coverage plan to keep you in business through any obstacle.</p>\r\n<h4><a href=\"/commercial-insurance/\">Read More</a></h4>\";s:6:\"filter\";b:0;}i:7;a:3:{s:5:\"title\";s:0:\"\";s:4:\"text\";s:423:\"<a href=\"/employee-benefits/\"><img src=\"/wp-content/uploads/IMG_0859.jpg\" alt=\"Widget 2\"/></a>\r\n<h3><a href=\"/employee-benefits/\" style=\"color:black;\">Employee Benefits</a></h3>\r\n<p>The right Employee Benefits plan will protect your company’s biggest asset: the employees. We take pride in finding the coverage that fits your specific business and employee needs.</p>\r\n<h4><a href=\"/employee-benefits/\">Read More</a></h4>\";s:6:\"filter\";b:0;}i:8;a:3:{s:5:\"title\";s:0:\"\";s:4:\"text\";s:473:\"<a href=\"/personal-insurance/\"><img src=\"/wp-content/uploads/shutterstock_141952666.jpg\" alt=\"Personal-Insurance-Corpus-Christi\"/></a>\r\n<h3><a href=\"/personal-insurance/\" style=\"color:black;\">For Individuals</a></h3>\r\n<p>Our Personal Insurance options give you the peace of mind when the unexpected happens. From home and personal auto insurance to life insurance, we help protect your life now and for the future.</p>\r\n<h4><a href=\"/personal-insurance/\">Read More</a></h4>\";s:6:\"filter\";b:0;}i:10;a:3:{s:5:\"title\";s:0:\"\";s:4:\"text\";s:61:\"[contact-form-7 id=\"1282\" title=\"Community Involvement Form\"]\";s:6:\"filter\";b:0;}s:12:\"_multiwidget\";i:1;}','yes'),(84,'widget_rss','a:2:{i:1;a:0:{}s:12:\"_multiwidget\";i:1;}','yes'),(85,'uninstall_plugins','a:2:{s:27:\"wp-pagenavi/wp-pagenavi.php\";s:14:\"__return_false\";s:35:\"googleanalytics/googleanalytics.php\";s:35:\"Ga_Admin::uninstall_googleanalytics\";}','no'),(86,'timezone_string','','yes'),(87,'page_for_posts','1185','yes'),(88,'page_on_front','23','yes'),(89,'default_post_format','0','yes'),(90,'link_manager_enabled','0','yes'),(91,'initial_db_version','24448','yes'),(92,'wp_user_roles','a:7:{s:13:\"administrator\";a:2:{s:4:\"name\";s:13:\"Administrator\";s:12:\"capabilities\";a:63:{s:13:\"switch_themes\";b:1;s:11:\"edit_themes\";b:1;s:16:\"activate_plugins\";b:1;s:12:\"edit_plugins\";b:1;s:10:\"edit_users\";b:1;s:10:\"edit_files\";b:1;s:14:\"manage_options\";b:1;s:17:\"moderate_comments\";b:1;s:17:\"manage_categories\";b:1;s:12:\"manage_links\";b:1;s:12:\"upload_files\";b:1;s:6:\"import\";b:1;s:15:\"unfiltered_html\";b:1;s:10:\"edit_posts\";b:1;s:17:\"edit_others_posts\";b:1;s:20:\"edit_