INSERT INTO `wp_posts` VALUES (5,5,'2013-11-21 19:50:02','2013-11-21 19:50:02','Whether it is for your <a title=\"Life Insurance\" href=\"http://livecarlisle.infinitecoders.com/personal-insurance/life-insurance/\">life</a>, your <a title=\"Home\" href=\"http://livecarlisle.infinitecoders.com/personal-insurance/home/\">home</a> or your <a title=\"Auto\" href=\"http://livecarlisle.infinitecoders.com/personal-insurance/auto/\">auto</a>, Carlisle Insurance can find you the right coverage plan to protect you now and prepare you for whatever comes next.\r\n\r\nWhether it is your first car, second home or third child, we can find a coverage plan that will protect what is most important to you. At Carlisle Insurance, we take pride in helping you understand your insurance policy so you can be prepared when the unexpected happens.\r\n\r\nWe tailor a personal insurance plan to your needs so you have the right amount of coverage for every area of your life. Our insurance professionals will identify gaps in your current coverage plan, and provide a plan to cover you financially in the areas that pose the greatest risk to you.\r\n\r\nYou can trust in Carlisle Insurance to find a coverage plan that will give you piece of mind to know you are protected now and in the future. Look over our types of personal insurance coverage for more information, helpful tools or a quote.','Personal Insurance','','publish','closed','closed','','personal-insurance','','','2014-10-21 22:32:02','2014-10-21 22:32:02','',0,'http://carlisle.infinitecoders.com/?page_id=5',0,'page','',0),(7,5,'2013-11-21 19:50:09','2013-11-21 19:50:09','For many of us, our home is our most valuable possession. If your home is damaged or destroyed, insurance can help you repair or rebuild your home and replace damaged possessions. The time to consider an unthinkable disaster is before it happens to you.\r\n\r\nThe main purpose of homeowner\'s insurance is to protect you against losses you cannot afford. Few people have the financial resources to rebuild their homes. In addition to protecting your home and possessions, homeowner’s insurance also provides liability coverage to protect you from financial ruin if someone is injured on your property and then sues for damages.\r\n\r\nWith all this in mind, a homeowner’s insurance policy consists of coverage for your dwelling and your personal property. It also includes liability insurance which pays for injuries to other people or damages to their property accidentally caused by you, members of your family, or your pets. You also can buy several types of additional insurance for property that is not listed in your homeowner’s policy or for perils not covered — such as flood — for which you need a separate policy. This can be accomplished by either buying a separate policy or by adding an endorsement or rider to your existing policy.\r\n<h2>Tips for Keeping Your Rates Low</h2>\r\nThere are some simple steps you can take to reduce your homeowner’s premiums.\r\n<ul>\r\n	<li>Raise Your Deductible - A deductible is the amount you pay before the insurance starts to pay for your loss. Since the purpose of insurance is to pay for the losses you cannot afford, raise your deductible to a limit that you could handle in case of a loss.</li>\r\n	<li>New Home - If your home is less than 10 years old, you may be eligible for a new home discount.</li>\r\n	<li>Make Your Home Safer - You may be eligible for a discount if you have a burglar and fire alarms systems and/or sprinkler systems. Monitored systems will earn a bigger discount than unmonitored systems.</li>\r\n	<li>Construction Material - When you buy a home, look for fire-resistant construction such as brick, masonry, or rock. You may pay a lower premium for hail-resistant roofs such as those made of concrete tile.  Conversely, wood roofs may bring a surcharge. Check the location of the nearest fire department, and avoid buying in flood prone areas.</li>\r\n</ul>\r\n&nbsp;','Home','','publish','closed','closed','','home','','','2014-03-11 20:08:46','2014-03-11 20:08:46','',5,'http://carlisle.infinitecoders.com/?page_id=7',0,'page','',0),(9,5,'2013-11-21 19:50:20','2013-11-21 19:50:20','When you buy an auto insurance policy, you are buying a package of individual coverages, with each coverage protecting you against different types of loss. Once you understand the various types of coverage, you can decide which ones to include in your personal insurance package. You can also determine the limits of coverage you will need. The following are some common areas of coverage found in a Corpus Christi auto insurance policy:\r\n\r\n<strong>Bodily Injury (BI) Liability Coverage</strong> pays, up to the coverage limits, for damages due to injury or death of others in a vehicle accident for which you or the operator of your vehicle is legally responsible. It also pays your legal defense costs. In most states, this coverage is mandatory.\r\n\r\n<strong>Property Damage (PD) Liability Coverage</strong> pays, up to the coverage limits, for damages to another individual\'s vehicle or property resulting from an accident for which you or the operator of your vehicle is legally responsible. In most states, this coverage is also mandatory.\r\n\r\n<strong>Medical Payments Coverage</strong> pays, up to the coverage limits, for reasonable and necessary doctor, hospital, and funeral expenses for you and your passengers injured or killed in an accident, regardless of who is at fault. Payments are usually limited to one to three years after the accident. This coverage is optional in most states which do not have no-fault insurance systems.\r\n\r\n<strong>Uninsured/Underinsured Motorists (UM/UIM)</strong> Coverage pays, up to the coverage limits, for bodily injury to you or your family resulting from the negligence of someone whose liability insurance limits are insufficient. The definition of an underinsured motorist varies from state to state.\r\n\r\n<strong>Collision Coverage</strong> pays, up to the coverage limits, for damage to your vehicle or a vehicle you are operating caused by a collision or rollover. This coverage is usually required if you have a vehicle loan.\r\n\r\n<strong>Comprehensive Physical Damage Coverage</strong> pays, up to the coverage limits, for damage to your vehicle or any vehicle in your custody resulting from theft, fire, vandalism, flooding, hail, or other perils (but not damage by collision or overturning). This coverage is usually required if you have a vehicle loan.\r\n\r\n<strong>Rental Reimbursement</strong> pays, up to a specified amount, for rental vehicle charges while your vehicle is being repaired for damage covered under your policy. If you prefer not to incur the cost of renting a vehicle yourself and cannot be without a vehicle while yours is being repaired, you might consider this coverage.\r\n\r\n<strong>Towing and Labor</strong> covers some costs incurred for services rendered at the place of breakdown or for towing to a repair shop. It covers the delivery of gas, oil, or a battery but not the cost of these items. If you lock the keys in the vehicle or need to have a tire changed, related services may also be covered. These services are often included in auto club memberships, which can result in unnecessary duplicate coverage.','Auto','','publish','closed','closed','','corpus-christi-auto-insurance','','','2014-03-12 22:08:08','2014-03-12 22:08:08','',5,'http://carlisle.infinitecoders.com/?page_id=9',0,'page','',0),(11,5,'2013-11-21 19:50:49','2013-11-21 19:50:49','Many states now require boats to be insured. If the purchase of your boat is financed, or if you use a marina, you will probably be required to insure your boat.  However, even if boat insurance is not required, it is still important that you consider purchasing boat insurance.\r\n\r\nBoat insurance is similar to the insurance you purchase for your car and can protect you in much the same way. But, since boats have different features than your car, you will want to make sure you have all the types of coverage that you might need, while at the same time being aware of any savings that may lower your premium.\r\n\r\nInsurance coverage you may wish to consider for your boat:\r\n<ul>\r\n	<li>Liability</li>\r\n	<li>Physical Damage</li>\r\n	<li>Theft</li>\r\n	<li>Medical Payments</li>\r\n	<li>Pollution/Fuel Spill Liability</li>\r\n	<li>Trailer Coverage</li>\r\n	<li>Discounts you may be entitled to:</li>\r\n</ul>\r\n<ol>\r\n	<li>  New Boat</li>\r\n	<li>  Automatic Fire Suppression System</li>\r\n	<li>  Ship-To-Shore Radio</li>\r\n	<li>  Approved Boating Education Course</li>\r\n</ol>\r\nSince every watercraft is unique, please make sure that you check with us to see if you need any additional coverage or if you could be eligible for any additional discounts.','Boat','','publish','closed','closed','','boat-insurance','','','2014-03-12 22:09:34','2014-03-12 22:09:34','',5,'http://carlisle.infinitecoders.com/?page_id=11',0,'page','',0),(12,5,'2013-11-21 19:50:58','2013-11-21 19:50:58','Condominiums and townhouses have special insurance needs.\r\nThey don\'t require as much insurance as a house, but owners of these dwellings have more to insure than does a renter. Typical insurance needs for a condo owner include personal property and liability coverage. A condominium owner should insure not only the personal possessions in the condo, but also any built-in units such as cabinets, fixtures, appliances, shelves and any other items not covered by the Master Condominium Policy. The liability portion of the policy would cover injuries or damages to people or property determined to be the responsibility of the condominium owner.\r\n\r\nBelow is a checklist of the top four questions to consider when choosing a condominium insurance policy:\r\n<ol>\r\n	<li>What are your ownership and insurance responsibilities specified in the condo association\'s Master Deed (the insurance requirements the association expects from you)?</li>\r\n	<li>Almost all associations have a master insurance policy that covers you for the actual structure and common elements such as a swimming pool or tennis court owned by all unit owners. The association documents and the master policy spell out very specifically where common areas end and where your unit begins. In some cases, for example, your unit may start inside the wallboard. In others, the wallboard may be considered part of your unit.</li>\r\n	<li>Does the policy you are considering include broad water damage coverage for problems such as sewer and drain back-ups?</li>\r\n	<li>Does your condo association provide comprehensive or blanket coverage to protect you against other condo owners who may not have adequate coverage?</li>\r\n	<li>Do you have expensive personal items such as jewelry or furs for which you may need additional personal property coverage?</li>\r\n</ol>','Condos/ Townhomes','','publish','closed','closed','','%ef%bf%bccondostownhomes','','','2014-03-11 20:04:34','2014-03-11 20:04:34','',5,'http://carlisle.infinitecoders.com/?page_id=12',0,'page','',0),(13,5,'2013-11-21 19:51:09','2013-11-21 19:51:09','Even though you may not own your own home, you still own personal property that can be lost to fires, burglaries, and even lawsuits.\r\n\r\nWhile most homeowners are insured for these risks, many renters are not. Renter\'s insurance is just as important to have as homeowner’s insurance.  Not only will it protect your personal items, but it will also help you secure temporary housing and provide liability protection, e.g. medical expenses incurred by individuals injured on your property.  Renter’s insurance may also pay for a lawyer if you are sued by someone unintentionally injured by you.\r\n\r\nIf the ceiling in your apartment is damaged by a storm, necessary repairs are the responsibility of your landlord.  But what if your brand new stereo and TV were damaged in the incident?  And while the ceiling is being fixed, do you have enough money to immediately pay for another place to stay? These are the types of expenses that would be covered by your renter’s insurance policy.','Renters','','publish','closed','closed','','renters','','','2014-03-11 20:15:42','2014-03-11 20:15:42','',5,'http://carlisle.infinitecoders.com/?page_id=13',0,'page','',0),(14,5,'2013-11-21 19:51:36','2013-11-21 19:51:36','Motorcycle insurance typically offers a combination of collision, liability, theft, and related coverage designed specifically to meet the needs of motorcycle owners. If you own a motorcycle—whether you ride it or not—you need this coverage to protect you from theft, collision, and other common exposures.\r\n\r\nSome factors which may affect motorcycle insurance premiums:\r\n<ul>\r\n	<li>Your driving record</li>\r\n	<li>Where you keep your cycle (in the open or in garage)</li>\r\n	<li>Your credit record</li>\r\n	<li>How many years you have been driving a motorcycle</li>\r\n	<li>Your age</li>\r\n	<li>Previous Cycle Coverage</li>\r\n	<li>Anti-theft devices</li>\r\n</ul>\r\n<h2>ATV Insurance</h2>\r\nMost states don\'t require ATV insurance, and you may have limited coverage if you have a homeowner’s policy. If you have an ATV, we urge you to contact Carlisle Insurance Agency and let us review your coverage to determine whether you need a separate ATV Policy.\r\n\r\nMany insurance companies offer discounts to help lower your premium such as:\r\n<ul>\r\n	<li>A discount for completing and approved ATV safety course</li>\r\n	<li>A discount for owning and insuring multiple ATVs</li>\r\n	<li>A discount for being a member of associations such as the Harley Owners Group (HOG), American Motorcyclist Association (AMA) or the Honda Rider\'s Club of America (HRCA)</li>\r\n</ul>','Motorcycle','','publish','closed','closed','','motorcycle','','','2014-03-11 20:12:34','2014-03-11 20:12:34','',5,'http://carlisle.infinitecoders.com/?page_id=14',0,'page','',0),(15,5,'2013-11-21 19:51:46','2013-11-21 19:51:46','Floods can happen any time or any place.\r\n\r\nYou don\'t have to live near water to be at risk. Flood claims can occur in low to moderate risk areas. Homeowner’s insurance does not cover flood damage, but Flood Insurance does. Flood insurance also covers damage caused by mudflow, dirt, and debris caused by moving water.\r\n\r\nHomeowners with mortgaged property in a Special Flood Hazard Area (SFHA) are now required by federal law to obtain flood insurance. Lenders must comply by requiring flood insurance on the outstanding mortgage balance for the life of the loan.\r\n\r\nKeep in mind that, while flood insurance is affordable, flood damage is not.\r\n\r\nYour coverage under a flood insurance policy is based on your home\'s value, minus your land value. Flood Insurance up to $250,000 is available for residential buildings, with the option of up to $100,000 for coverage of contents. Excess flood insurance is available to extend coverage above these limits.\r\n\r\nThere is a 30 day waiting period in effect before a flood insurance policy becomes effective, so the best way to protect your home is to act now, before flooding happens.','Flood','','publish','open','open','','flood','','','2014-03-11 20:04:55','2014-03-11 20:04:55','',5,'http://carlisle.infinitecoders.com/?page_id=15',0,'page','',0),(16,5,'2013-11-21 19:52:13','2013-11-21 19:52:13','While an individual or family health insurance policy may cost more than a group policy, it is certainly better than not having health insurance coverage at all. An unexpected illness or serious injury can cause a family’s financial ruin if at least some basic coverage is not in place.\r\n\r\nMost insurance companies offer the same types of managed healthcare plans to individuals that they offer to groups: HMOs (Healthcare Maintenance Organizations), PPOs (Preferred Provider Organizations), and POSs (Point of Service Plan).  Generally speaking, these companies offer different deductible levels to keep premiums within the policy holder’s budget.\r\n\r\nCarlisle Insurance Agency is here to assist you in finding a plan that protects you and your family while staying within your budget. Please contact us today to help evaluate your health insurance options.','Individual Health','','publish','closed','closed','','individual-health','','','2014-03-11 20:09:15','2014-03-11 20:09:15','',5,'http://carlisle.infinitecoders.com/?page_id=16',0,'page','',0),(18,5,'2013-11-21 19:52:54','2013-11-21 19:52:54','<h2>Overview</h2>\nAt Carlisle Insurance, we work hard to create a customized commercial insurance coverage plan that meets the specific needs of your business. We work hard to get an accurate assessment of the exposures you may have in your current practices. From there, we are able to provide you with the best value by finding the perfect coverage with the highest rated insurance carriers.\n\nCarlisle separates itself from other agencies by taking pride not just in what we do, but in understanding your business as well. We bring you comprehensive quotes that outline every area of coverage that we recommend. Our team of brokers is dedicated to understanding your business so that you can confidently select and understand the coverage you are given.\n\nBut our service doesn’t stop there. After your coverage plan is approved, you will have a dedicated independent insurance team member working along side you for any questions or challenges that may arise. It is our service that sets us apart and gives you the full benefit of pride in your protection.\n\nWhile we will craft the right plan for you, Carlisle Insurance offers all types of insurance for business owners. Among them <a title=\"Property\" href=\"http://carlisleins.wpengine.com/commercial-insurance-corpus-christi/property/\">property insurance</a>, <a title=\"General Liability\" href=\"http://carlisleins.wpengine.com/commercial-insurance-corpus-christi/general-liability/\">liability policies</a>, <a title=\"Commercial Auto\" href=\"http://carlisleins.wpengine.com/commercial-insurance-corpus-christi/commercial-auto/\">commercial auto coverage</a>, <a title=\"Workers’ Compensation\" href=\"http://carlisleins.wpengine.com/commercial-insurance-corpus-christi/workers-compensation/\">workers’ compensation</a>,<a title=\"Employee Benefits\" href=\"http://carlisleins.wpengine.com/employee-benefits/\"> employee benefits</a>, and others. These coverage types are a short list of all that Carlisle Insurance offers. We recommend that you contact us to thoroughly review the commercial insurance needs of your business.\n\n<span style=\"line-height: 1.5em;\"> </span>','Commercial Insurance','','publish','closed','closed','','commercial-insurance-corpus-christi','','','2015-01-07 17:18:59','2015-01-07 17:18:59','',0,'http://carlisle.infinitecoders.com/?page_id=18',0,'page','',0),(19,5,'2013-11-21 19:54:36','2013-11-21 19:54:36','When you own or operate a business, you <strong>Take Pride</strong> in hiring the right people to make your company a success. As your key asset, it is important to protect your employees. The right employee benefits package is essential to safeguard the people who keep your company running. Through our <a title=\"Navigator Discovery Process\" href=\"http://carlisleins.wpengine.com/employee-benefits/disability/\">Navigator Discovery Process</a>, we will help you maximize the value of every dollar spent on employee benefits.\r\n\r\nAt Carlisle Insurance, we understand how important your employees are to your business. We can help you create the right employee benefits package to include <a title=\"Benefit Programs\" href=\"http://carlisleins.wpengine.com/employee-benefits/dental-insurance/\">health, dental, vision, life, and disability insurance</a>. We will provide you with flexible, affordable options obtained through competitive marketing that will protect your employees and make them proud to be a part of your company.\r\n\r\nEmployee satisfaction is vital to retaining top employees. Many employees don’t take full advantage of their benefits because they don’t understand them. Through our <a title=\"Benefits Administration Enrollment\" href=\"http://carlisleins.wpengine.com/employee-benefits/vision-insurance/\">Benefits Administration and Enrollment program</a>, our account managers act as an extension of your HR department to help educate your employees on the full value of their benefits and increase employee appreciation of their total compensation.\r\n\r\nIn today’s complicated legal and regulatory environment, we can help you to stay in compliance with Health Care Reform, COBRA, HIPPA, FMLA, ERISA, and ADA through our <a title=\"Compliance Support\" href=\"http://carlisleins.wpengine.com/employee-benefits/health-insurance/\">Compliance Support</a> services.\r\n\r\nAt Carlisle Insurance, our <a title=\"Employer Services\" href=\"http://carlisleins.wpengine.com/employee-benefits/life-insurance/\">Employer Services </a>bring value to your HR team.  We assist our clients by offering HR Services, Benefits Management and Payroll Programs, COBRA, FSA and HSA administration as well as wellness programs.\r\n\r\n&nbsp;\r\n\r\nFor more information on Employee Benefits, please contact us at one of our four locations.\r\n\r\n<b><br clear=\"all\" /> </b>\r\n\r\n<b> </b>','Employee Benefits','','publish','closed','closed','','employee-benefits','','','2014-04-04 14:50:50','2014-04-04 14:50:50','',0,'http://carlisle.infinitecoders.com/?page_id=19',0,'page','',0),(23,3,'2013-11-06 15:36:56','2013-11-06 15:36:56','<h1></h1>\r\n<h1 style=\"text-align: center;\">Our Philosophy</h1>\r\n<p style=\"text-align: justify;\">At Carlisle Insurance we Take Pride in offering quality insurance since 1925. Our family of trusted experts proudly provide you with a personalized coverage plan to protect your business and your family now and in the future. We build our protection around the ideals of strength, security and stability, so you can keep moving forward through whatever life throws your way. When you put your trust in Carlisle Insurance, you can Take Pride knowing we work hard to cover what matters most.</p>','Home','','publish','open','open','','home','','','2017-09-14 19:16:17','2017-09-14 19:16:17','',0,'http://carlisle.infinitecoders.com/?page_id=23',0,'page','',0),(28,5,'2013-11-21 19:52:02','2013-11-21 19:52:02','Homeowner’s, auto, and watercraft policies have a limit on liability insurance. If an unfortunate accident should occur, and it is your fault, do you have sufficient liability coverage from your current policies to handle the related costs? Since no one can predict what amount of damages you cause an injured party, Umbrella Insurance is a type of protection important for every policyholder, not just the wealthy.\r\n\r\nUmbrella Insurance is designed to provide additional liability protection above and beyond the limits on homeowner’s, auto, and watercraft personal insurance policies.\r\n\r\nLiability insurance is the portion of a homeowner’s or auto policy that pays for expenses such as the injured person’s medical bills, rehabilitative therapy, and any lost wages due to the negligence of the person at fault. The liability portion of an insurance policy also provides for legal defense if such representation should become necessary. When considering all of the medical expenses required for the injured party and the legal fees incurred by the negligent individual, the standard liability coverage available through homeowner’s or auto policies is often found to be insufficient. Almost every state has financial responsibility laws that will hold drivers accountable for bodily injury and property damage resulting from car accidents, and the driver found to be at fault can be sued for these damages. Personal assets of the driver at fault could also be seized as part of the resulting lawsuit. Similar laws are also in force for home and watercraft owners.\r\n\r\nBut there is good news. A personal liability umbrella insurance policy can give one added liability protection at a reasonable cost. Additional liability insurance is often inexpensive, particularly when weighed against the additional coverage that one gains. Furthermore, liability insurance covers one’s non-business activities anywhere in the world. These days, the added protection provided by a liability umbrella policy is something that no one should be without.','Umbrella','','publish','closed','closed','','umbrella','','','2014-03-11 20:16:59','2014-03-11 20:16:59','',5,'http://carlisle.infinitecoders.com/?page_id=28',0,'page','',0),(30,3,'2013-11-06 20:16:08','2013-11-06 20:16:08',' ','','','publish','open','open','','30','','','2013-11-11 21:41:15','2013-11-11 21:41:15','',0,'http://carlisle.infinitecoders.com/?p=30',1,'nav_menu_item','',0),(33,5,'2013-11-21 19:53:16','2013-11-21 19:53:16','Commercial property insurance can cover the buildings that a business owns - along with their contents and inventory - against physical loss or damage.\n\nIf you don\'t own your building, you\'ll still need contents coverage. In most policies, commercial property insurance for business contents covers furniture, fixtures, inventory, office equipment, and other supplies stored at your facility or off-premises. You may insure those items for replacement cost or for actual cash value (ACV), which pays only for the depreciated value of the property.\n\nReplacement cost policies have higher premiums, but they can help your business recover from a loss faster, since you can replace all of the lost or damaged property with new items. If you lease some of the equipment at your business, the leasing company may require that you insure the property at replacement value.','Property','','publish','closed','closed','','property','','','2015-01-07 17:25:09','2015-01-07 17:25:09','',18,'http://carlisle.infinitecoders.com/?page_id=33',0,'page','',0),(46,3,'2013-11-06 21:41:08','2013-11-06 21:41:08','','Carlisle Insurance','','publish','closed','closed','','company-name','','','2014-04-04 14:18:14','2014-04-04 14:18:14','',0,'http://carlisle.infinitecoders.com/?post_type=business&#038;p=46',0,'business','',0),(56,3,'2013-11-07 20:40:38','2013-11-07 20:40:38','Name\r\n[text* your-name placeholder \"Johnny Appleseed\"]\r\nEmail\r\n[email* your-email placeholder \"jappleseed@domain.com\"] \r\nMessage\r\n[textarea* your-message placeholder \"Send us a message...\"]\r\n[honeypot honeypot-966]\r\n[submit \"Submit\"]\nCarlisle Website Contact Form Submission\n[your-name] <[your-email]>\nFrom: [your-name] <[your-email]>\r\n\r\nMessage Body:\r\n[your-message]\r\n\r\n--\r\nThis e-mail was sent from a contact form on Infinite Theme (http://carlisle.infinitecoders.com)\ncarlisleins@carlisleins.com, takepride@carlisleins.com,\n\n\n\n\n\n[your-subject]\n[your-name] <[your-email]>\nMessage Body:\r\n[your-message]\r\n\r\n--\r\nThis e-mail was sent from a contact form on Infinite Theme (http://carlisle.infinitecoders.com)\n[your-email]\n\n\n\n\nYour message was sent successfully. Thanks.\nFailed to send your message. Please try later or contact the administrator by another method.\nValidation errors occurred. Please confirm the fields and submit it again.\nFailed to send your message. Please try later or contact the administrator by another method.\nPlease accept the terms to proceed.\nPlease fill the required field.\nNumber format seems invalid.\nThis number is too small.\nThis number is too large.\nYour entered code is incorrect.\nDate format seems invalid.\nThis date is too early.\nThis date is too late.\nEmail address seems invalid.\nURL seems invalid.\nTelephone number seems invalid.\nFailed to upload file.\nThis file type is not allowed.\nThis file is too large.\nFailed to upload file. Error occurred.\nYour answer is not correct.\nThis input is too long.\nThis input is too short.','Contact Form','','publish','open','open','','contact-form-1','','','2015-03-18 16:19:29','2015-03-18 16:19:29','',0,'http://carlisle.infinitecoders.com/?post_type=wpcf7_contact_form&#038;p=56',0,'wpcf7_contact_form','',0),(59,3,'2013-11-11 20:18:55','2013-11-11 20:18:55',' ','','','publish','open','open','','59','','','2013-11-11 21:41:15','2013-11-11 21:41:15','',0,'http://carlisle.infinitecoders.com/?p=59',2,'nav_menu_item','',0),(68,3,'2013-11-11 21:41:15','2013-11-11 21:41:15',' ','','','publish','open','open','','68','','','2013-11-11 21:41:15','2013-11-11 21:41:15','',0,'http://carlisle.infinitecoders.com/?p=68',5,'nav_menu_item','',0),(69,3,'2013-11-11 21:41:15','2013-11-11 21:41:15',' ','','','publish','open','open','','69','','','2013-11-11 21:41:15','2013-11-11 21:41:15','',0,'http://carlisle.infinitecoders.com/?p=69',4,'nav_menu_item','',0),(70,3,'2013-11-11 21:41:15','2013-11-11 21:41:15',' ','','','publish','open','open','','70','','','2013-11-11 21:41:15','2013-11-11 21:41:15','',0,'http://carlisle.infinitecoders.com/?p=70',3,'nav_menu_item','',0),(109,5,'2013-11-21 20:02:00','2013-11-21 20:02:00','Employment Practices liability coverage protects an employer against employee claims such as:\r\n<ul>\r\n	<li>Wrongful Termination</li>\r\n	<li>Sexual or Workplace Harassment</li>\r\n	<li>Wrongful Discipline</li>\r\n	<li>Age Discrimination</li>\r\n	<li>Violation of Employment Discrimination Laws</li>\r\n	<li>Violation of Americans with Disabilities Act</li>\r\n	<li>Wrongful Failure to Employ or Promote</li>\r\n	<li>Wrongful Deprivation of a Career Opportunity</li>\r\n	<li>Breach of Employment Contract</li>\r\n	<li>Employment Related Misrepresentation</li>\r\n	<li>Failure to Adopt Adequate Workplace Employment Policies &amp; Procedures</li>\r\n	<li>Illegal Retaliatory Treatment</li>\r\n	<li>Invasion of Privacy</li>\r\n	<li>Negligent Evaluation</li>\r\n	<li>Employment-related Wrongful Infliction of Emotional Distress</li>\r\n</ul>\r\n&nbsp;','Employment Practices Liability','','publish','closed','closed','','employment-practices-liability','','','2014-03-11 20:35:52','2014-03-11 20:35:52','',18,'http://carlisle.infinitecoders.com/?page_id=109',0,'page','',0),(110,5,'2013-11-21 20:01:42','2013-11-21 20:01:42','Directors and Officers liability insurance is designed to provide protection for the directors and officers of a company if they are sued for actions taken during the performance of their duties to the company. This type of insurance is similar to Errors and Omissions insurance, but the key difference is that E&amp;O insurance covers failure and negligence as they relate to products and services, not to the performance of managerial duties.  It is often advisable for businesses to carry both types of insurance. Generally speaking, claims made by stockholders, employees, and clients will be made against the company itself as well as the directors of the company.  This being the case, it is important that Directors and Officers insurance be in place, in order to protect the personal assets of the company’s executives.  Typically, allegations levied against directors and officers have to do with acts, decisions, errors, or omissions which have lowered the value of a company’s stock or somehow weakened the company’s position in its industry. In today’s business climate, Directors and Officers insurance is an absolute necessity for many companies.  Contact the experts at Carlisle Insurance to be sure that you and your business are properly protected with Directors and Officers Insurance.','Directors & Officers Policy','','publish','closed','closed','','directors-officers-policy','','','2014-03-11 20:34:24','2014-03-11 20:34:24','',18,'http://carlisle.infinitecoders.com/?page_id=110',0,'page','',0),(117,5,'2013-11-21 22:05:38','2013-11-21 22:05:38','In 2013, Corrigan Benefits and Carlisle Insurance Agency’s Employee Benefits division merged together into Carlisle-Corrigan Benefits, LLC.  The merger brought together two strong employee benefits organizations to better serve our clients. Today, the combined entity conducts business as Carlisle Insurance and has the resources, personnel, and knowledge that makes them the number one employee benefits team in the area.\r\n\r\n&nbsp;','Carlisle-Corrigan Benefits LLC','','publish','closed','closed','','long-term-care','','','2014-04-04 14:14:43','2014-04-04 14:14:43','',19,'http://carlisle.infinitecoders.com/?page_id=117',0,'page','',0),(129,5,'2013-11-21 22:06:45','2013-11-21 22:06:45','Carlisle Insurance Agency offers a wide range of coverage options for Public Entities. We are partnered with the largest school risk management programs in Texas and recognized as a leader in the industry for school district insurance.  We offer coverage including but not limited to Building &amp; Contents, Crime, General Liability, Mobile Equipment, Automobile Liability, Automobile Physical Damage, Equipment Breakdown, Educators\' Legal Liability/School Board Liability, and Workers\' Compensation. Additionally, we specialize in Wind/Hail coverage for those districts located along the Gulf Coast in Tier 1 counties.  Whether it is Property &amp; Casualty or Workers\' Compensation, Carlisle Insurance Agency provides risk management and loss control services that your school district needs to keep insurance costs at a minimum so that more district funds are available to educate your students.\r\n<h2>Public Entity Team</h2>\r\nJerry Bravenec, CIC - jerryb@carlisleins.com\r\n\r\nChase Carlisle, CIC - chasec@carlisleins.com\r\n\r\nDon Clark - donc@carlisleins.com','Public Entities','','publish','closed','closed','','school-districts','','','2014-06-10 20:01:46','2014-06-10 20:01:46','',133,'http://carlisle.infinitecoders.com/?page_id=129',0,'page','',0),(131,5,'2013-11-21 19:52:21','2013-11-21 19:52:21','There are many types of life insurance, all designed to fit individual needs and circumstances. The following are some of the basic types of life insurance available:\r\n\r\n<b>Term Insurance</b> – This is simplest form of life insurance.  With Term Insurance, you purchase coverage for a specific price covering a specified period. If you die during that time, your beneficiary receives the value of the policy. There is no investment component.\r\n\r\n<b>Whole Life</b> - Similar to Term Insurance, but you purchase the policy to cover your \"whole life\" not just a set period. Premiums remain level throughout the life of the policy, and the company invests at least a portion of your premiums. Some firms share investment proceeds with policyholders in the form of a dividend.\r\n\r\n<b>Universal Life</b> - You decide how much money you want to put into the policy over and above a minimum premium. The company chooses the investment vehicle, which is generally restricted to bonds and mortgages. The investment and the returns go into a cash-value account, which you can use to pay premiums or allow to accumulate.\r\n\r\nAnother variation of a universal policy, often called Universal Variable Life, allows policyholders to choose investment vehicles.\r\n\r\n<b>Variable Life</b> - With a variable policy, there is usually a wider selection of investment products, including stock funds. As with a universal policy, returns on investments can offset the cost of premiums or accumulate in the account. And depending on the type of policy, the beneficiaries will either receive the face value of the policy or the face value plus all or part of the cash account.\r\n\r\n&nbsp;','Life Insurance','','publish','closed','closed','','life-insurance','','','2014-03-11 20:12:00','2014-03-11 20:12:00','',5,'http://carlisle.infinitecoders.com/?page_id=17',0,'page','',0),(132,5,'2013-11-21 19:51:53','2013-11-21 19:51:53','Carlisle Insurance handles a large number of windstorm insurance policies along the Texas Coast. As a result, we have a lot of experience and expertise in the matter. We can go through your existing policies and identify areas where you need additional coverage, or let you know if your current insurance coverage is sufficient for a windstorm.\r\n\r\nMore and more hurricanes seem to be threatening the coastline every season and unfortunately a lot of insurance policies do not cover all that damage a windstorm can cause. Now is definitely the time to make sure that you have enough coverage in the unfortunate event that your property is hit by a hurricane or other windstorm. With the right insurance plan in place to cover windstorm damage, you’ll be sufficiently covered as you begin the rebuilding process. While dealing with hurricane damage is never easy, with the right windstorm insurance plan you can overcome the challenges and get back to normal a lot quicker and with fewer headaches.\r\n\r\nProviding that assistance to businesses and people is a big reason that we have stayed in the business of insuring windstorm damage for years, and that experience will give us the upper hand to provide you with the highest level of service.\r\n\r\nPlease check out our <a title=\"Hurricane Preparedness\" href=\"http://livecarlisle.infinitecoders.com/customer-services-claims/hurricane-preparedness/\">hurricane preparedness</a> page for valuable information.','Windstorm','','publish','closed','closed','','windstorm','','','2014-03-11 20:17:37','2014-03-11 20:17:37','',5,'http://carlisle.infinitecoders.com/?page_id=26',0,'page','',0),(133,5,'2013-11-21 19:56:29','2013-11-21 19:56:29','<h2></h2>\r\n<h2><a title=\"Oil &amp; Gas\" href=\"http://carlisleins.wpengine.com/special-insurance-programs/oil-gas/\">OIL &amp; GAS</a></h2>\r\nThe oil and gas industry has helped grow our agency for the last 65 years and at Carlisle Insurance we take pride in understanding the specifics of the business. We have developed a special program to meet the needs of this specialized industry.  Our program consists not only of competitive pricing, but offers some of the most broadest coverages you can purchase. We understand then needs of the oil and gas industry and have added many additional benefits and services to the program, such as ISNetwork assistance and maintenance services.\r\n<h2><a title=\"School Districts\" href=\"http://carlisleins.wpengine.com/special-insurance-programs/school-districts/\">Public Entity</a></h2>\r\nCarlisle Insurance takes pride in knowing how to protect schools, students, teachers and the community. We understand that saving money on insurance helps puts funding back into what\'s important, the students. We are experienced in providing insurance for school districts, and offer insurance coverage options for school districts of various sizes.  We are partnered with the largest school risk management programs in Texas and recognized as a leader in the industry. Whether your district is located inland or on the coast, we have a solution for you.\r\n<h2><a title=\"Property Insurance\" href=\"http://carlisleins.wpengine.com/special-insurance-programs/windstorm-insurance/\">PROPERTY INSURANCE</a></h2>\r\nWhether it be office buildings, retail shopping centers, condominiums/apartments, or municipalities, Carlisle Insurance has the team of experts to provide the coverages you need to weather any storm. Not all insurance policies cover damage from windstorms, and we t<strong>ake pride</strong> in finding you a plan that does.\r\n<h2><a title=\"Trucking Insurance\" href=\"http://carlisleins.wpengine.com/special-insurance-programs/trucking/\">TRUCKING INSURANCE</a></h2>\r\nOur specialized trucking insurance program can cover any size of business. From fleets of one or two trucks to fleets consisting of hundreds of trucks, our program will work for you. We can offer coverage for liability, physical damage, cargo, workers’ compensation and more. We provide multiple services including Fleet Safety Management Systems, driver training programs, safety meeting topics, ISNetworld maintenance services and more to create a comprehensive insurance program to meet your trucking needs. You can take pride in us to cover your trucking needs and keep your business moving.\r\n<h2><a title=\"Hotel/Motel Insurance\" href=\"http://carlisleins.wpengine.com/special-insurance-programs/hotelmotel-insurance/\">HOTEL &amp; MOTEL</a></h2>\r\nWe recognize that there are special insurance needs within the hotel and motel industry, and our experts at Carlisle Insurance can put together the right package of insurance coverage to protect your business, your workers and your guests. Our program will provide the right insurance coverages to cover you against property loss, lost revenue, liability, theft and more.','Special Insurance Programs','','publish','closed','closed','','special-insurance-programs','','','2014-06-10 20:00:40','2014-06-10 20:00:40','',0,'http://carlisle.infinitecoders.com/?page_id=65',0,'page','',0),(134,5,'2013-11-21 19:56:55','2013-11-21 19:56:55','<h2>CLAIMS</h2>\r\nWe are here to help you with your claim. Some insurance companies require claims to be reported directly to them.  The list of those companies is below.  If your insurance company is not listed below or if you prefer to consult with us about your claim please call our claims specialist:\r\n\r\nRoland Garcia\r\n\r\nDirect: 361-453-4435\r\n\r\nCell: 361-455-9862\r\n\r\n&nbsp;\r\n\r\nFor after-hours emergencies you may also contact:\r\n\r\nTom Carlisle:  361-548-0700\r\n\r\nPeter Matl:     361-658-6865\r\n\r\n&nbsp;\r\n\r\nDirect Reporting Companies:\r\n<ul>\r\n	<li><a href=\"http://carlisleins.wpengine.com/customer-services-claims/cl-claims/\" target=\"_blank\">Commercial Insurance Claims</a></li>\r\n	<li><a href=\"http://carlisleins.wpengine.com/customer-services-claims/pl-claims/\" target=\"_blank\">Personal Insurance Claims</a></li>\r\n</ul>\r\n&nbsp;\r\n\r\nPrior to a Loss:\r\n<ul>\r\n	<li><a title=\"Property Loss\" href=\"http://livecarlisle.infinitecoders.com/customer-services-claims/property-loss/\">Be prepared for a Property Loss</a></li>\r\n	<li><a title=\"Auto Loss or Accident\" href=\"http://carlisleins.wpengine.com/customer-services-claims/vehicle-accident-report/\">Be prepared for an Auto Accident</a></li>\r\n</ul>\r\n&nbsp;\r\n\r\n<strong>When you provide a check as payment, you authorize us either to use information from your check to make a one-time electronic fund transfer from your account or to process the payment as a check transaction. For inquiries, please call (361) 664-4348.</strong>','Customer Services & Claims','','publish','closed','closed','','customer-services-claims','','','2017-03-16 14:35:13','2017-03-16 14:35:13','',0,'http://carlisle.infinitecoders.com/?page_id=67',0,'page','',0),(135,5,'2013-11-21 19:57:10','2013-11-21 19:57:10','At Carlisle Insurance, whether it is for yourself, your business or both, we<strong> Take Pride</strong> in providing a personalized plan to give you the right coverage now to provide peace of mind in the future. We understand what it means to be proud of what you have, and how important it is to know that it is protected. We are proud to offer the strength to protect you when you need it most, the security of a plan tailored to your needs, and the stability of an enduring insurance agency.\r\n\r\nSince 1925, Carlisle Insurance has provided clients with protection through any obstacle. We have grown our business to operate in multiple locations and continue to offer quality protection to meet the growing needs of those who count on us. At Carlisle Insurance, we view ourselves as more than just an insurance agency; we are a family of professionals who <strong>Take Pride</strong> in our commitment to covering what matters most to you.\r\n\r\nWe pride ourselves on certified employees you can trust to have the skills and experience to find the right plan for you and your company. We believe it is important to take the extra effort and make sure our employees are some of the most educated and most prepared to handle your business. Whether it is our brokers or service representatives, our team members are committed to identifying the right coverage for your business, your home and your life.\r\n\r\nWe <strong>Ta</strong><strong>ke Pride</strong> in our ability to cover your business and your needs so you can be ready for what could happen next. As a long-standing company, the Carlisle Insurance family knows what it takes to be successful and we will continue to work towards that success with pride to serve you in the future. When you trust in Carlisle Insurance, you trust in coverage you can be proud of.','About Us','','publish','closed','closed','','about-us','','','2015-01-07 01:44:16','2015-01-07 01:44:16','',0,'http://carlisle.infinitecoders.com/?page_id=68',0,'page','',0),(136,5,'2013-11-21 19:57:21','2013-11-21 19:57:21','','Contact Us','','publish','open','open','','contact-us','','','2014-03-11 19:48:28','2014-03-11 19:48:28','',0,'http://carlisle.infinitecoders.com/?page_id=69',0,'page','',0),(137,5,'2013-11-25 21:59:27','2013-11-25 21:59:27','If you operate a hotel or a motel, you know all about the unique insurance needs of your industry.  Fortunately, so does Carlisle Insurance.\r\n\r\nGenerally, hotel insurance combines several different types of insurance that are necessary to provide proper coverage for this very specialized business.  By consulting an expert at Carlisle Insurance, you will be certain that your business, your employees, and your guests will be protected against certain losses which might occur at your hotel or motel.\r\n<h2>The coverages may include:</h2>\r\n<strong>Guests’ Property</strong> – This covers the possessions of guests staying at a hotel or motel.\r\n\r\n<strong>Contents</strong> – This insures the contents of the hotel against loss or damage.\r\n\r\n<strong>Business Income</strong> – This insures against the loss of profits which may be incurred due to a loss.\r\n\r\n<strong>Liability</strong> – This coverage protects against claims made by third parties as the result of accidental injury on the hotel or motel grounds.\r\n\r\n<strong>Workers\' Compensation</strong> - This insurance covers an employer’s liability which may result from injuries to employees while at work.\r\n\r\n<strong>Umbrella/Excess Liability</strong> - Required for Franchised Hotels and Motels.\r\n\r\n<strong>Theft by Employees</strong> – This protects the hotel or motel in the event of a theft by an employee.\r\n\r\n<strong>Computer Breakdown</strong> - This covers the failure of computer equipment and / or the loss of computer records.\r\n\r\nAdditional coverage is also available for:  customer inconvenience remuneration expenses, delivery errors and omissions, service errors and omissions, and lost master keys or key cards.\r\n\r\nRunning a hotel or a motel is a tough business.  Get in touch with Carlisle Insurance today and make it a little bit easier!','Hotel/Motel Insurance','','publish','closed','closed','','hotelmotel-insurance','','','2014-03-11 20:19:45','2014-03-11 20:19:45','',133,'http://carlisle.infinitecoders.com/?page_id=126',0,'page','',0),(138,5,'2013-11-21 19:57:54','2013-11-21 19:57:54','Liability insurance is designed to protect the business against losses in the event that they are found to be negligent or liable for property damage or bodily injury to third parties. Typically, damages, legal defense fees, and settlement charges are paid by the insuring company when a claim is filed against the business.\r\n<h2>Products and Completed Operations</h2>\r\nThis type of coverage can provide liability protection for your company\'s completed products or services. If an injury occurs due to the use of your products or services provided, the policy would pay for the resulting damages and any legal expenses up to the policy limits.\r\n<h2>Medical Payments</h2>\r\nIf someone is injured by you or at your business site, the policy may pay for medical and funeral expenses incurred, up to policy limits, within one year of the accident.\r\n<h2><b>Personal Injury</b></h2>\r\nMost General Liability Insurance policies provide coverage if you are accused of:\r\n<ul>\r\n	<li>Publishing inaccurate information that slanders or libels a person or an organization</li>\r\n	<li>Publishing material that violates a person\'s right of privacy</li>\r\n	<li>Falsely arresting, detaining, or imprisoning someone</li>\r\n	<li>Maliciously prosecuting someone</li>\r\n	<li>Wrongfully evicting someone</li>\r\n</ul>\r\n<h2>Advertising Injury</h2>\r\nThis policy will provide valuable liability protection against advertising injuries resulting from claims that, in the course of advertising your company\'s own goods, products, or services, you are accused of:\r\n<ul>\r\n	<li>Publishing inaccurate information that slanders or libels a person or an organization</li>\r\n	<li>Publishing material that violates a person\'s right of privacy</li>\r\n	<li>Copying some other company\'s advertising ideas or style of doing business</li>\r\n	<li>Infringing on another company\'s copyright, title or slogan</li>\r\n</ul>','General Liability','','publish','closed','closed','','general-liability','','','2014-10-21 19:41:17','2014-10-21 19:41:17','',18,'http://carlisle.infinitecoders.com/?page_id=73',0,'page','',0),(139,5,'2013-11-21 19:58:15','2013-11-21 19:58:15','Commercial auto liability coverage provides protection for vehicles owned or leased by a business. Policies usually include physical damage coverage for your vehicle as well as bodily injury and property damage to others.  If you or any of your employees have an accident in a business vehicle, you may be liable for bodily injury, lost wages, and other damages.\r\n<h2>Typical coverage includes:</h2>\r\n<h3>Bodily Injury Liability</h3>\r\nCoverage for damages that involve bodily injury to others for which you become responsible under law.\r\n<h3>Property Damage Liability</h3>\r\nCoverage for damage to property of others for which you become responsible under law.\r\n<h3>Medical Payments</h3>\r\nCoverage for reasonable and necessary medical expenses or funeral services for those who are accidentally injured or killed while in your vehicle or while getting into or out of your vehicle.\r\n<h3>Personal Injury Protection</h3>\r\nCoverage for medical expenses, hospitalization, rehabilitation, loss of wages, or loss of services resulting from injury.\r\n<h2>Other available coverage options:</h2>\r\n<h3>Comprehensive</h3>\r\nProtection for the loss of or damage to your vehicle and its equipment from all causes except collision, subject to the deductible on the policy.\r\n<h3>Collision</h3>\r\nProtection for the collision damage to your vehicle and its equipment, subject to the deductible on the policy.\r\n<h3>Uninsured Motorist</h3>\r\nThis coverage allows you to recover bodily injury damages due to an accident where the other party does not have insurance and is found legally liable.\r\n<h3>Underinsured Motorist</h3>\r\nThis coverage allows you to recover bodily injury damages due to an accident where the other party is found legally liable and does not have adequate liability limits.\r\n<h3>Additional Expense</h3>\r\nCoverage for necessary additional expenses incurred as a result of a loss for which you are protected under comprehensive or collision coverage. These expenses include rental cars, food, lodging, and other incidental expenses.\r\n<h3>Hired Auto Liability Coverage</h3>\r\nThis covers liability for automobiles hired under contract on behalf of or loaned to the insured party.\r\n<h3>Hired Auto Physical Damage</h3>\r\nCoverage for physical damage to autos that are leased, hired, rented or borrowed.','Commercial Auto','','publish','closed','closed','','commercial-auto','','','2015-03-17 20:27:34','2015-03-17 20:27:34','',18,'http://carlisle.infinitecoders.com/?page_id=75',0,'page','',0),(140,5,'2013-11-21 19:58:23','2013-11-21 19:58:23','Workers\' Compensation protects your employees if an injury should occur during the course of their employment with your company.  Payments are made to the injured party and may cover medical payments, loss of wages, and the cost of necessary therapy.\r\n\r\nSince each state has different regulations and laws governing Workers\' Compensation insurance, consult your broker or the appropriate state regulatory body for the requirements applicable to your state.\r\n\r\nAt the very minimum, Workers\' Compensation insurance policies will cover an employee\'s medical expenses and reimburse him or her for some percentage of lost wages.\r\n\r\nAlmost all states are \"open market\", which means that the coverage is underwritten by private insurers.  A few states are \"closed\" or \"monopolistic,\" with the coverage underwritten by a state-sponsored fund (ND, OH, WA and WY).  In states that are “open,” rates are competitive and vary among insurance carriers.','Workers\' Compensation','','publish','closed','closed','','workers-compensation','','','2014-03-11 19:47:59','2014-03-11 19:47:59','',18,'http://carlisle.infinitecoders.com/?page_id=76',0,'page','',0),(141,5,'2013-11-21 19:58:37','2013-11-21 19:58:37','Professional liability insurance can protect you against claims of negligence made by your clients if you are a physician, a lawyer, an architect, or any other sort of professional practitioner.  The name applied to the various types of professional liability coverage varies according to the profession involved.  In the case of the medical profession, medical malpractice insurance is offered.  A notary public, a real estate broker, or a website developer might need errors and omissions insurance.\r\n\r\nProfessional liability insurance coverage is necessary in many instances, because a general liability insurance policy only covers claims for bodily injury, property damage, personal injury, or advertising injury.  This type of insurance does not cover negligence, violation of good faith, misrepresentation, or inaccurate advice.   In order to be insured against these types of claims, a professional liability insurance policy must be in force.\r\n\r\nIf you are a professional, you must be covered for any eventuality.   Call Carlisle Insurance today for advice on ways to protect yourself and your business.\r\n\r\n&nbsp;','Professional Liability','','publish','closed','closed','','professional-liability','','','2014-03-11 19:47:07','2014-03-11 19:47:07','',18,'http://carlisle.infinitecoders.com/?page_id=77',0,'page','',0),(142,5,'2013-11-21 20:02:12','2013-11-21 20:02:12','There are many business situations in which a bond is needed. At Carlisle Insurance Agency, we have the experience to provide you with all of the bonds you need in order to conduct your business. Call us today and we will help you put your company in a position to handle any new business opportunities that arise. We know the importance of being bonded, and we understand that it is mandatory for certain contracts that you enter into in order to maximize your profitability. That is why we offer our expertise in helping you to figure out exactly what you need.\r\n<h2>Contract Surety Bonds</h2>\r\n<ul>\r\n	<li>Bid Bonds – Bid bonds guarantee that all bidders will honor the contract they offer and the terms that they bid on if they are selected as the winning bidder. They require a cash deposit.</li>\r\n	<li>Performance Bonds - These bonds guarantee that a project undertaken by a contractor will be completed satisfactory and as promised, and they are usually required as soon as a winning bid is selected during the bidding process.</li>\r\n	<li>Payment Bonds - A payment bond guarantees that all subcontractors and suppliers on a given project will be properly paid by a contractor. They are required on all Federal projects that are worth more than $30,000.</li>\r\n	<li>Maintenance Bonds – This bond offers protection to the recipient of a contract on any defects or faults in the materials or in the workmanship of the project.</li>\r\n	<li>Subdivision Bonds – A subdivision bond guarantees any work that is required by the government and protects the landowner who must get the work contracted out.</li>\r\n</ul>\r\n<h2>Commercial Bonds</h2>\r\nLicense and Permit Bonds – There are a variety of license and permit bonds available, and depending upon the type of business you are running, you may need one or more to properly run your business.','Bonds','','publish','closed','closed','','bonds','','','2014-03-11 19:41:33','2014-03-11 19:41:33','',18,'http://carlisle.infinitecoders.com/?page_id=80',0,'page','',0),(143,5,'2013-11-21 20:02:25','2013-11-21 20:02:25','A buy-sell agreement, which is also referred to as a buyout agreement, is an arrangement that is made between co-owners of a business to determine what will happen if one of the owners dies, becomes disabled, or chooses to leave the business.  This type of agreement is sometimes called a “business will,” because it clearly determines the course of action that will be taken if certain situations should arise.  The key question here is whether there would be enough money to fund a buyout if any of the triggering events (death of a partner, retirement, etc.) should occur.  To ensure that all provisions of your buy-sell agreement can be properly funded and to be sure that the that the future of your business is safe and secure, contact Carlisle Insurance today.\r\n\r\n&nbsp;','Funding of Buy-Sell Agreements','','publish','closed','closed','','funding-of-buy-sell-agreements','','','2014-03-11 19:44:45','2014-03-11 19:44:45','',18,'http://carlisle.infinitecoders.com/?page_id=81',0,'page','',0),(144,5,'2013-11-21 20:02:40','2013-11-21 20:02:40','Key Man Insurance coverage offers your business protection in the unfortunate event that a key employee suffers death or extended disability. When an employee is so important to your company that their loss could significantly damage your business in the long term, it is important that you protect your interests. When putting together a business insurance package, you should always include Key Man coverage. It provides you with coverage for financial losses that would be directly tied to the loss of a necessary employee.\r\n\r\nThe importance of Key Man insurance coverage is magnified if your company offers professional services and some of your employees cannot be quickly replaced for a number of reasons. Whether you are not able to replace them for legal or ethical considerations, such as in a medical office or a law firm, or because their talent would be hard to replace, you need to make sure that your business is protected for any and all eventualities.\r\n\r\nIn many instances, a business would be in significant trouble with the loss of just one individual. If your company is in a similar situation, it is critical that you not leave your business’s future well-being at risk. Key Man or key person coverage can provide you with the financial assistance necessary to keep your company afloat in the unfortunate event that you lose an essential employee. That help can give you enough time to find a suitable replacement and get back to business as usual.\r\n\r\nContact Carlisle Insurance Agency today to find out whether a Key Man insurance policy is appropriate for your business model.','Key Man Coverage','','publish','closed','closed','','key-man-insurance-coverage','','','2014-03-12 21:57:32','2014-03-12 21:57:32','',18,'http://carlisle.infinitecoders.com/?page_id=82',0,'page','',0),(145,5,'2013-11-21 22:04:31','2013-11-21 22:04:31','We understand that keeping up with legislation that affects insurance, your industry and your business can be difficult.  Since the passage of the Patient Protection and Affordable Care Act (PPACA) on March 23, 2010, many employers are feeling overwhelmed by the additional responsibilities, as well as the financial and administrative impacts affecting their business. Carlisle Insurance can help. We have the knowledge and resources you need covering:\r\n<ul>\r\n	<li>Health Care Reform\r\n<ul>\r\n	<li>Compliance Checklists and Timelines</li>\r\n	<li>Legislative Updates and Guides</li>\r\n	<li>Employee Educational Materials</li>\r\n	<li>PPACA Calculators</li>\r\n</ul>\r\n</li>\r\n	<li>COBRA</li>\r\n	<li>HIPAA</li>\r\n	<li>FMLA</li>\r\n	<li>ERISA</li>\r\n	<li>ADA</li>\r\n	<li>Compliance Document Preparation</li>\r\n</ul>','Compliance Support','','publish','closed','closed','','health-insurance','','','2015-01-28 16:26:47','2015-01-28 16:26:47','',19,'http://carlisle.infinitecoders.com/?page_id=83',0,'page','',0),(146,5,'2013-11-21 22:06:02','2013-11-21 22:06:02','We are a member of United Benefit Advisors.   UBA is a member owned alliance of more than 140 premier independent benefit advisory firms with more than 165 offices throughout the US, Canada and the U.K. and is the 3<sup>rd</sup> largest provider of employee benefits in North America. Member firms combine their collective power and coordinated resources to obtain the most competitive rates and enhanced employer services. By collaborating with over 2000 experienced benefits professionals in UBA, we deliver ideas, expertise and best-in-class solutions that positively impact employers make a real difference in the lives of their employees and families.\r\n<p style=\"text-align: center;\"> <a href=\"http://carlisleins.wpengine.com/wp-content/uploads/uba1.jpg\"><img class=\"alignnone size-medium wp-image-969\" alt=\"uba\" src=\"http://carlisleins.wpengine.com/wp-content/uploads/uba1-300x39.jpg\" /></a></p>\r\n<p align=\"center\"></p>','United Benefit Advisors','','publish','closed','closed','','supplemental-insurance','','','2015-01-28 16:43:51','2015-01-28 16:43:51','',19,'http://carlisle.infinitecoders.com/?page_id=84',0,'page','',0),(147,5,'2013-11-21 22:04:55','2013-11-21 22:04:55','Below are the different types of benefit programs that Carlisle Insurance can offer your business:\r\n\r\n<strong>Medical</strong>\r\n\r\nMedical plans provide health coverage for employees.   We will help you navigate the spectrum of options from fully insured to self-funded plans while keeping you in compliance with the various laws and regulations affecting medical plans.\r\n\r\n<strong>Dental</strong>\r\n\r\nDental plans provide coverage for costs associated with dental care.\r\n\r\n<strong>Life</strong>\r\n\r\nLife insurance is an important benefit for an employee’s family.   Upon an employee’s death, this coverage provides their beneficiaries a fixed sum or periodic income.\r\n\r\n<strong>Vision</strong>\r\n\r\nVision plans provide coverage for eye care services and products.\r\n\r\n<strong>Disability</strong>\r\n\r\nDisability plans provide income to an employee while the employee is temporarily unable to do their job.  The two types of plans, Short Term Disability and Long Term Disability, provide coverage based on the duration of the disability.\r\n\r\n<strong>Voluntary Products</strong>\r\n\r\nThese products supplement insurance plans provided by the employer.  Employees can choose which programs meet their needs.\r\n\r\n<strong>Retirement Plans</strong>\r\n\r\nProviding the availability for employees to save for their future through convenient payroll deductions, with or without employer assistance in financing the program, can be another great tool for increasing employee tenure.','Benefit Programs - Texas Dental Insurance','','publish','closed','closed','','dental-insurance','','','2015-01-28 16:23:08','2015-01-28 16:23:08','',19,'http://carlisle.infinitecoders.com/?page_id=118',0,'page','',0),(148,5,'2013-11-21 22:05:22','2013-11-21 22:05:22','<b>Navigator Discovery Process</b>\r\n\r\nWe want you to be able to maximize the value created by every dollar spent on employee benefits.  To achieve this, we use the proprietary Navigator Discovery Process to acquire a deep understanding of your company’s unique needs.  This process assesses your current efforts and identifies the best possible solutions to achieve your goals.  We then implement your custom strategic Benefits Blueprint to help you protect and elevate your company’s relationship with your employees.','Navigator Discovery Process','','publish','closed','closed','','disability','','','2014-04-04 14:52:12','2014-04-04 14:52:12','',19,'http://carlisle.infinitecoders.com/?page_id=119',0,'page','',0),(149,5,'2013-11-21 22:05:11','2013-11-21 22:05:11','At Carlisle Insurance, our goal is to achieve a long-term relationship focused on bringing value to your employee benefits management and insurance programs. We assist our clients by offering services in an array of topics, including:\r\n<ul>\r\n	<li>HR Services</li>\r\n	<li>Benefits Management</li>\r\n	<li>Payroll Services</li>\r\n	<li>Time and Labor Management</li>\r\n	<li>COBRA Administration</li>\r\n	<li>FSA Administration</li>\r\n	<li>Health Savings Accounts</li>\r\n	<li>Health Reimbursement Arrangements</li>\r\n	<li>Wellness Programs</li>\r\n	<li>Benchmarking</li>\r\n</ul>','Employer Services','','publish','closed','closed','','life-insurance','','','2015-01-28 16:34:48','2015-01-28 16:34:48','',19,'http://carlisle.infinitecoders.com/?page_id=120',0,'page','',0),(150,5,'2013-11-21 22:06:36','2013-11-21 22:06:36','Running an oil &amp; gas operation is no easy task.  Carlisle Insurance has offered oil &amp; gas insurance for over 50 years.  Let us review your exposures to see if our program is a fit for you.\r\n\r\nWe provide oil and gas insurance for customers of all sizes, both onshore and offshore operations including:\r\n<ul>\r\n	<li>Operators</li>\r\n	<li>Drilling contractors</li>\r\n	<li>Workovers</li>\r\n	<li>Well loggers</li>\r\n	<li>Non-operators</li>\r\n	<li>Service contractors</li>\r\n	<li>Geophysical services</li>\r\n	<li>Equipment rental</li>\r\n	<li>Perforators</li>\r\n	<li>Pipeline contractors</li>\r\n	<li>Manufacturing and wholesale/retail firms with 50% or more oil and gas related revenues</li>\r\n</ul>\r\n<strong>Pollution / Environmental Liability</strong>\r\nEnvironmental coverage can be a technical topic. Nonetheless, it plays a huge part in the Oil &amp; Gas industry. There are different types of pollution and environmental coverages that can offered. Different businesses have different environmental exposures. Contact an expert at Carlisle Insurance today to discuss your exposures and find out what you need.\r\n\r\n<strong>Program Benefits</strong>\r\n\r\nOur program was developed specifically for your industry. We understand that needs of the oil and gas industry and want to help your business run smoother. Therefore, we have added additional benefits to the program that include ISNetworld maintenance and setup, safety training program, and many more. Contact us today to discuss the added services and benefits this program has to offer.','Oil & Gas','','publish','closed','closed','','oil-gas','','','2014-03-11 20:20:18','2014-03-11 20:20:18','',133,'http://carlisle.infinitecoders.com/?page_id=128',0,'page','',0),(151,5,'2013-11-21 22:06:53','2013-11-21 22:06:53','At Carlisle Insurance, we understand how to properly insure property risks against loss. Being that we are located on the Gulf Coast, we specialize in protecting property that is exposed to catastrophic events. We have a reputation for being one of the top insurers of properties located in catastrophic windstorm prone areas. Our agency has partnered with the largest reinsurers and companies in the world, to provide our customers with the most comprehensive and competitive programs out there.\r\n\r\nWhether it be office buildings, retail shopping centers, condominiums/apartments, or municipalities, Carlisle Insurance has the team of experts to provide the coverages you need to weather any storm.\r\n\r\nPlease visit our <a title=\"Hurricane Preparedness\" href=\"http://livecarlisle.infinitecoders.com/customer-services-claims/hurricane-preparedness/\">Hurricane Preparedness</a> page for valuable information on how we are prepared for you.','Property Insurance','','publish','closed','closed','','windstorm-insurance','','','2014-04-04 16:00:52','2014-04-04 16:00:52','',133,'http://carlisle.infinitecoders.com/?page_id=130',0,'page','',0),(152,5,'2013-11-21 22:08:10','2013-11-21 22:08:10','When you are involved in a property claim, events can be confusing and important information can be overlooked. That is why we made it simple for you to record vital details of the claim. You can print this page or copy it to your document to edit for your records. If you have further questions please <a title=\"Stay Connected\" href=\"http://livecarlisle.infinitecoders.com/contact-us/stay-connected/\">contact us</a>.\r\n<h2>Read This First</h2>\r\nIf you have a property claim to file, follow these simple steps to speed up the processing of your claim. The more information we have, the faster and more fairly we can settle your claim.\r\n<h2>Start Preparation Today</h2>\r\nWrite down any valuable items with their serial numbers (usually found on the bottom or back of major appliances) along with the method of acquisition (purchased, inherited, or received as a gift), date purchased and prices or approximate value. Attach receipts, if possible. Remember to include furniture, appliances, carpeting, jewelry, artwork, toys and the contents of your closets, cabinets, and drawers.\r\n<h2>Videotape Documentation</h2>\r\nVideotaping each room of your house can make taking inventories easier. Photographs and a tape recorder can substitute for a video camera. A complete inventory should contain verbal descriptions of major assets as well as their value. Remember your garage, attic, basement, and the exterior of the house plus your landscaping and fencing.\r\n<h2><b>Household Documentation</b></h2>\r\nExtremely important documentations should be photocopied. Keep one copy in your home and the original, where possible, in a safe-deposit box. Important items include, but are not limited to, the following:\r\n<ul>\r\n	<li>House: Escrow, title, deed, insurance policy</li>\r\n	<li>Personal: Birth certificates, medical history, passports, insurance certificates, credit card numbers, will</li>\r\n	<li>Automobile: Certificate of ownership, finance contracts, registrations, insurance policy, driver\'s licenses</li>\r\n	<li>Finance: Account numbers for checking and savings accounts, CDs, stocks, bonds, other significant investments</li>\r\n	<li>Tax: Copies of the first two pages of your state and federal returns for the past five years. Completed returns with approximate receipts and canceled checks should be kept in a separate file box</li>\r\n</ul>','Property Loss','','publish','closed','closed','','property-loss','','','2016-05-06 20:13:55','2016-05-06 20:13:55','',1373,'http://carlisle.infinitecoders.com/?page_id=135',0,'page','',0),(153,5,'2013-11-21 22:08:00','2013-11-21 22:08:00','Your Customer Service Representative is available for all of your customer service requests, including auto ID cards and insurance certificates. Because every customer’s needs are different, it is important that you talk to someone who is familiar with your account. We have worked hard to build a staff of experts in a number of different areas of insurance coverage so we can provide you with only the highest level of service. We’ll take your personal needs into account and help you put together solutions that perfectly match what makes sense for you.\r\n\r\nOur employees have many years of combined experience and have successfully been providing customers with quality service that keeps them coming back for all of their insurance needs.  If you need assistance today, give us a call or send us an email and we wil<a name=\"_GoBack\"></a>l provide you with a response as quickly as possible.','Customer Service Requests','','publish','closed','closed','','customer-service-requests','','','2014-03-12 22:03:26','2014-03-12 22:03:26','',134,'http://carlisle.infinitecoders.com/?page_id=136',0,'page','',0),(155,5,'2013-11-21 22:08:23','2013-11-21 22:08:23','When you are involved in an accident, events can be confusing and important information can be overlooked. That is why we made it simple for you to record vital details of the accident. If you have further questions, please <a title=\"Stay Connected\" href=\"http://livecarlisle.infinitecoders.com/contact-us/stay-connected/\">contact us</a>.\r\n<h2>Read This First</h2>\r\nIf you have a vehicle accident report to file, follow these simple steps to speed up the processing of your claim. The more information we have, the faster and more fairly we can settle your claim.\r\n<ul>\r\n	<li>Call the Police</li>\r\n	<li>Stay at the scene</li>\r\n	<li>Do not discuss the accident with anyone but the Police at the scene</li>\r\n	<li>Do not discuss details of your insurance coverage or your policy limits</li>\r\n	<li>Get a Police Report Number if possible</li>\r\n	<li>Write down the names, addresses and phone numbers of others involved in the accident, including witnesses</li>\r\n	<li>Write down the license numbers and insurance company names and policy numbers of everyone involved in the accident</li>\r\n</ul>\r\n<h2>Accident Notes</h2>\r\nUse the form to record your own recollection of the accident as soon as you can while details are still fresh in your memory. Write the date and time of the accident and the weather and road conditions. Write down all details you can think of even if they do not seem important to you. IMPORTANT - If you have a camera or a Cell Phone with picture capability, take some shots of the scene, vehicle damage, etc.\r\n<h2>Accident Information Form - Witnesses</h2>\r\nPlease complete as much of the following information as possible:\r\n<ul>\r\n	<li>Did you see the accident?</li>\r\n	<li>Were you involved in the accident?</li>\r\n	<li>Describe the accident.</li>\r\n	<li>Did anyone appear to be hurt?</li>\r\n	<li>Who, if anyone, do you feel was responsible?</li>\r\n	<li>Your Name</li>\r\n	<li>Your Address</li>\r\n	<li>Your Phone Numbers at home and work</li>\r\n</ul>\r\n<h2>Accident Information Form - Other Driver</h2>\r\nYour Information that is needed:\r\n<ul>\r\n	<li>Name</li>\r\n	<li>Address</li>\r\n	<li>Home Address</li>\r\n	<li>Work Phone</li>\r\n	<li>Driver\'s License #</li>\r\n	<li>Insurance Agent</li>\r\n	<li>Insurance Company</li>\r\n	<li>Insurance Policy #</li>\r\n	<li>Are you injured?</li>\r\n</ul>\r\nPassenger Information that is needed for a vehicle accident report:\r\n<ul>\r\n	<li>Name</li>\r\n	<li>Address</li>\r\n	<li>Phone #</li>\r\n	<li>Are you injured?</li>\r\n</ul>','Auto Loss','','publish','closed','closed','','vehicle-accident-report','','','2016-05-06 20:14:26','2016-05-06 20:14:26','',1373,'http://carlisle.infinitecoders.com/?page_id=137',0,'page','',0),(156,5,'2013-11-21 22:08:35','2013-11-21 22:08:35','<div class=\"video-player\"><iframe src=\"//www.youtube.com/embed/OCB82J_vrcc\" height=\"480\" width=\"640\" allowfullscreen=\"\" frameborder=\"0\"></iframe></div>\r\nCarlisle Insurance firmly believes in service. That is why we have invested our resources to insure that we are ready to serve you in the event of a catastrophic incident. Our goal is to get your claims adjusted as fast as possible so that you can get back on track. Our hurricane preparation plan consists of a two level approach. The following lists the highlights.\r\n<ul>\r\n	<li><b>Your data is protected.</b> Our client information, including information on your property locations and coverage, is backed up and stored off site daily.</li>\r\n	<li><b>Level one disaster.</b> In case of a disaster or evacuation affecting one of our offices, the fax and phone lines will be rerouted to one of our other three offices in South Texas.  Any of our offices can handle the operations for any other office.</li>\r\n	<li><b>Level two disaster.</b> In case of a large scale or prolonged disaster we have partnered with Agility Recovery Solutions (<a href=\"http://www.agilityrecovery.com\">www.agilityrecovery.com</a>), a national disaster recovery company, to get us up and going very soon after a disaster.  They had an excellent track record of providing service after the Katrina and Rita hurricanes. Within 48 hours after the disaster, Agility Recovery will bring in trailers, computers, satellite data and phone connections and generators to create a fully functional office.  The fax and phone lines will be rerouted through the satellite connections to enable seamless communication with our clients.</li>\r\n</ul>\r\n<b>What you should do in case of a loss:</b>\r\n<ul>\r\n	<li><b>Promptly report your loss to us. </b> Please call the office you usually deal with or call our claims office directly at 1-888-664-4349.</li>\r\n	<li><b>To the best of your ability protect your property from further damage or loss by making temporary repairs.</b>  In times of widespread damage it may not be possible for you to retain a contractor to assist with these repairs for several days after the event.   Please take photos of any damage prior to making any temporary repairs.   Do not make any permanent repairs until an adjustor inspects the damage.</li>\r\n	<li><b>Keep copies of all invoices and expense incurred.</b>  <b>Make sure they are detailed.</b></li>\r\n	<li><b>In cases of theft or vandalism immediately notify the local police.  Keep a copy of the police report.</b></li>\r\n	<li><b>Complete an inventory of damage to your building and/or contents.</b></li>\r\n</ul>\r\n<b>Useful Links:</b>\r\n<ul>\r\n	<li>For information on safety tips, contact the Institute for Business and Home Safety at <a href=\"http://www.disastersafety.org/\">www.disastersafety.org</a></li>\r\n	<li>For up to date tracking of approaching hurricanes access the National Oceanographic &amp; Atmospheric Administration at <a href=\"http://www.noaa.gov/\">www.noaa.gov</a></li>\r\n	<li>For road conditions including status of hurricane evacuation routes go to <a href=\"http://www.txdot.gov/\">www.txdot.gov</a></li>\r\n</ul>\r\n<b>Please Note:</b>\r\n<ul>\r\n	<li>Standard insurance policies exclude flood damage. A flood policy is a separate policy and takes effect 30 days after it is purchased.</li>\r\n</ul>','Hurricane Preparedness','','publish','closed','closed','','hurricane-preparedness','','','2014-04-04 16:09:05','2014-04-04 16:09:05','',134,'http://carlisle.infinitecoders.com/?page_id=138',0,'page','',0),(157,5,'2013-11-21 22:08:48','2013-11-21 22:08:48','<p style=\"text-align: center;\"><a href=\"http://carlisleins.wpengine.com/wp-content/uploads/trusted-choice1.jpg\"><img class=\"alignnone  wp-image-991\" alt=\"trusted choice\" src=\"http://carlisleins.wpengine.com/wp-content/uploads/trusted-choice1.jpg\" width=\"140\" height=\"122\" /></a></p>\r\nWe are a Trusted Choice® Independent Insurance Agency with access to multiple companies and a commitment to quality service that enables us to offer our clients competitive pricing, a broad choice of products and unparalleled advocacy.\r\n\r\nAs a Trusted Choice® independent insurance agency, we are dedicated to you and are committed to treating you as a person, not a policy. This commitment means we shall:\r\n<ul>\r\n	<li>Work with you to identify the insurance and financial services that are right for you, your family or your business and use our access to multiple companies to deliver those products.</li>\r\n	<li>Guide you through the claims process for a prompt and fair resolution of your claim. Help you solve problems related to your coverage or account.</li>\r\n	<li>Explain the coverages and options available to you through our agency, at your request.</li>\r\n	<li>Return your phone calls and e-mails promptly and respond to your requests in a timely manner.</li>\r\n	<li>Provide 24/7 services for our customers, offering any or all of the following: emergency phone numbers, Internet account access, e-mail and call center services.</li>\r\n	<li>Use our experience and multiple company relationships to customize your coverage as needed.</li>\r\n	<li>Commit our staff to continuing education so they may be more knowledgeable in serving you.</li>\r\n	<li>Treat you with respect and courtesy.</li>\r\n	<li>Conduct our business in an ethical manner.</li>\r\n</ul>\r\nWe pledge this to you, our clients and ask that you let us know if we fail to meet our commitment, so we may take corrective action.','Trusted Choice','','publish','closed','closed','','trusted-choice-independent-insurance','','','2014-04-04 15:12:42','2014-04-04 15:12:42','',135,'http://carlisle.infinitecoders.com/?page_id=139',0,'page','',0),(158,5,'2013-11-21 22:09:00','2013-11-21 22:09:00','At Carlisle Insurance, we  <strong>Take Pride</strong> in our community by giving back to it. In 1925, our agency was founded on the principles of always doing the right thing and helping others. This principle continues today, as our agency continues to support many different organizations throughout the community.\r\n<ul>\r\n	<li style=\"text-align: left;\">Corpus Christi Chamber of Commerce</li>\r\n	<li style=\"text-align: left;\">Regional Economic Development Council</li>\r\n	<li style=\"text-align: left;\">Corpus Christi Hispanic Chamber of Commerce</li>\r\n	<li class=\"sub-bullet\" style=\"text-align: left;\">South Texas Association of General Contractors</li>\r\n	<li class=\"sub-bullet\" style=\"text-align: left;\">Texas Oil &amp; Gas Association</li>\r\n	<li class=\"sub-bullet\" style=\"text-align: left;\">Palmer Drug Abuse Program</li>\r\n	<li class=\"sub-bullet\" style=\"text-align: left;\">Catholic Charities</li>\r\n	<li class=\"sub-bullet\" style=\"text-align: left;\">Christus Spohn Hospital</li>\r\n	<li class=\"sub-bullet\" style=\"text-align: left;\">Driscoll Children’s Hospital</li>\r\n	<li class=\"sub-bullet\" style=\"text-align: left;\">Coastal Conservation Association</li>\r\n	<li class=\"sub-bullet\" style=\"text-align: left;\">Saltwater Enhancement Association</li>\r\n	<li class=\"sub-bullet\" style=\"text-align: left;\">The Ark Assessment Center &amp; Emergency Shelter for Youth</li>\r\n	<li class=\"sub-bullet\" style=\"text-align: left;\">Foster Angels of South Texas</li>\r\n	<li class=\"sub-bullet\" style=\"text-align: left;\">CASA</li>\r\n	<li class=\"sub-bullet\" style=\"text-align: left;\">Del Mar College</li>\r\n	