ge for liability, physical damage, motor truck cargo, workers’ compensation and more. We take a lot of pride in providing all of our customers with the highest level of service available, so we will sit down with you and go through all of your options. We provide assistance in picking out the right plan without making you feel pressured into spending more money than you can afford for a plan that provides you with more coverage than you need.\r\n\r\nOur program includes many additional benefits and services. Some of these include fleet management services, DOT compliance, safety and driver training as well as many more. Contact a Carlisle Insurance expert today to learn more about our truck insurance.','Trucking Insurance','','publish','closed','closed','','trucking','','','2014-03-11 20:21:24','2014-03-11 20:21:24','',133,'http://carlisle.infinitecoders.com/?page_id=393',0,'page','',0),(395,3,'2013-11-25 23:14:17','2013-11-25 23:14:17',' ','','','publish','closed','closed','','395','','','2018-09-05 20:08:22','2018-09-05 20:08:22','',133,'http://carlisle.infinitecoders.com/?p=395',28,'nav_menu_item','',0),(400,3,'2013-11-26 20:09:32','2013-11-26 20:09:32','','logo-slider','','inherit','closed','open','','logo-slider','','','2013-11-26 20:09:32','2013-11-26 20:09:32','',0,'http://carlisle.infinitecoders.com/wp-content/uploads/logo-slider.png',0,'attachment','image/png',0),(403,3,'2013-11-26 23:24:11','2013-11-26 23:24:11','','Staff','','publish','closed','closed','','acf_staff','','','2013-12-17 17:20:04','2013-12-17 17:20:04','',0,'http://carlisle.infinitecoders.com/?post_type=acf&#038;p=403',0,'acf','',0),(412,3,'2010-11-26 23:46:38','2010-11-26 23:46:38','','Tom Carlisle, CIC','','publish','closed','closed','','tom','','','2020-01-13 16:58:51','2020-01-13 16:58:51','',0,'http://carlisle.infinitecoders.com/?post_type=our_staff&#038;p=412',0,'our_staff','',0),(414,3,'2013-11-26 23:53:15','2013-11-26 23:53:15','[contact-form-7 id=\"528\" title=\"Contact Page\"]','St