nsurance coverage or your claim. We do not sell or market your non-public personal information.</p>\r\n<strong>The Information We Collect</strong>\r\n\r\nWe collect non-public personal information about you from a variety of sources. The information we collect allows us to properly underwrite and rate your insurance policy and to complete the other transactions incidental to your insurance policy. Sources of information include:\r\n<ul>\r\n	<li>Information we receive from you on applications or other forms</li>\r\n	<li>Information about your transactions with us, our affiliates, or others</li>\r\n	<li>Information we receive from a consumer reporting agency</li>\r\n	<li>Driver information from the state motor vehicle departments</li>\r\n	<li>Medical or financial information</li>\r\n	<li>The Information We Disclose</li>\r\n</ul>\r\nWe do not disclose any non-public personal information about our policyholders except as permitted by law. In some cases this information can be disclosed to third parties without your authorization. These disclosures may include those made to your insurance company, appraisers, independent adjusters, insurance regulators, and/or your mortgage lender or lienholder. It is the agency\'s normal procedure that your policy could be re-marketed for purposes of renewing or replacing it. We do not sell our customer lists.\r\n\r\n<strong>How We Protect Your Personal Information</strong>\r\n\r\nWe restrict access to your personal information to those employees who need it to provide the insurance products and services you have requested. We maintain physical, electronic and procedural safeguards to protect your personal information.\r\n\r\nThis notice is required by federal law. If you would like any additional information, please contact us.','Privacy Policy','','publish','closed','open','','privacy-policy','','','2014-03-12 22:10:33','2014-03-12 22:10:33','',0,'http://carlisle.infinitecoders.com/?page_id=708',0,'page','',0),(711,4,'2014-02-05 21:39